import React, { useState,useContext } from 'react'
import {BarangContext} from './BarangContext'
import Barang from './Barang'

const ListBarang = () => {
    const [barang,setBarang]=useContext(BarangContext);
    const unique = [...new Set(barang)];

    return (
        <div>
            {unique.map(unique => (
                <Barang key ={unique.id}
                        id={unique.id}
                        tglMasuk = {unique.tglMasuk}
                        tglKeluar={unique.tglKeluar}
                        nama={unique.nama} 
                        harga={unique.harga}
                        stok={unique.stok}
                        counter={unique.count}/>
            ))}
        </div>
    )
}

export default ListBarang
